import { useState } from "react";
import { Link } from "react-router-dom";
import React from "react";
import "./Navbar2.css";
import FaBars from "react-icons";
function MY_Navbar2(props) {
  const [isOpen, setIsOpen] = useState(false);
  const theme = props.theme;

  function toggleSidebar() {
    setIsOpen(!isOpen);
  }

  return (
    <div className={`content ${isOpen ? "open" : ""}`}>
      <div className="sidebar-toggle" onClick={toggleSidebar}>
        <i className="fa fa-bars"></i>
      </div>
      <div className={`header-links ${isOpen ? "open" : ""}`}>
        <div className="logo"></div>
        <Link className={`header-items`} to="/home">
          Home
        </Link>
        <Link className={`header-items`} to="/movie">
          Movie
        </Link>
        {/* <Link className={`header-items` } to="/popular">Popular</Link> */}
        <Link className={`header-items`} to="/top_anime">
          Top Anime
        </Link>
        <Link className="header-items" to="/watch">
          Watch Here
        </Link>
        <Link className="header-items" to="/random_img">
          Random Image
        </Link>
      </div>
    </div>
  );
}
export default MY_Navbar2;







